const Header = () => {
    return (
        <div>
            <h1>Meals</h1>
            <div>
                <a href="/">Bangladeshi</a>
                <a href="/">Indian</a>
                <a href="/">Login</a>
            </div>
        </div>
    );
};

export default Header;
